import React, { useState, useEffect } from "react";
import { useNavigate, Link } from "react-router-dom";
import axios from "axios";
import Spinner from "./Spinner";
import Alert from "./Alert";

const Invoices = ({ invoiceType }) => {
  const navigate = useNavigate();

  // State variables
  const [isLoading, setIsLoading] = useState(true);
  const [invoices, setInvoices] = useState([]);
  const [alertType, setAlertType] = useState(null);
  const [alertMessage, setAlertMessage] = useState("");

  // Fetch invoices when the component mounts or invoiceType changes
  useEffect(() => {
    const fetchInvoices = async () => {
      try {
        const response = await axios.get(`/invoices?type=${invoiceType}`);

        if (response.status === 200) {
          if (response.data.length === 0) {
            setAlertType("warning");
            setAlertMessage(`No ${invoiceType} invoices found.`);
          } else {
            setInvoices(response.data);
          }
        } else {
          setAlertType("danger");
          setAlertMessage(
            `Failed to retrieve ${invoiceType} invoices: ${response.status} ${response.statusText}`
          );
        }
        setIsLoading(false);
      } catch (error) {
        setAlertType("danger");
        setAlertMessage(
          `Failed to retrieve ${invoiceType} invoices: ${error.message}`
        );
        setIsLoading(false);
      }
    };

    fetchInvoices();
  }, [invoiceType]);

  // Handle the action of viewing an invoice
  const handleViewInvoice = (invoice) => {
    const viewInvoiceUrl = `view?id=${invoice._id}`;
    navigate(viewInvoiceUrl);
  };

  return (
    <div className="container mt-4">
      {isLoading ? (
        <Spinner />
      ) : (
        <>
          <h2>{invoiceType === "sales" ? "Sales" : "Purchase"} Invoices</h2>

          <Link to="add" className="btn btn-outline-secondary mt-3 mb-4">
            Add {invoiceType === "sales" ? "Sales" : "Purchase"} Invoice
          </Link>

          {alertMessage ? (
            <Alert type={alertType} message={alertMessage} />
          ) : (
            <table className="table table-striped table-hover">
              <thead>
                <tr>
                  <th>Invoice Date</th>
                  <th>Invoice No.</th>
                  <th>Due Date</th>
                  <th>{invoiceType === "sales" ? "Customer" : "Vendor"} Name</th>
                  <th>Total Items</th>
                  <th>Invoice Total</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {invoices.map((invoice) => (
                  <tr key={invoice._id}>
                    <td>{invoice.invoice.invoiceDate}</td>
                    <td>{invoice.invoice.invoiceNo}</td>
                    <td>{invoice.invoice.dueDate}</td>
                    <td>
                      {invoice.partner.firstName} {invoice.partner.lastName}
                    </td>
                    <td>{invoice.invoice.invoiceItems.length}</td>
                    <td>
                      ${parseFloat(invoice.invoice.invoiceTotal).toLocaleString()}
                    </td>
                    <td>
                      <button
                        className="btn btn-sm btn-outline-primary me-2"
                        onClick={() => handleViewInvoice(invoice.invoice)}
                      >
                        <i className="bi bi-eye-fill me-2"></i>View Invoice
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </>
      )}
    </div>
  );
};

export default Invoices;
